<body>
    <div class="container">
        <div id="progress" class="progress">
            <div id="progressbar" class="progress-bar progress-bar-striped active" role="progressbar" aria-valuenow="0" aria-valuemin="0" aria-valuemax="100">
            </div>
        </div>
        <p>
            <div id="slideshow-container">
                <div id="slideshow-content">
                    <div id="leadtime-total">
                    </div>
                    <div id="leadtime-per-label">
                    </div>
                </div>
                <div id="slideshow-controls">
                    <nav>
                        <ul class="pager">
                            <li><a href="#" id="previous">Previous</a></li>
                            <li><a href="#" id="next">Next</a></li>
                        </ul>
                    </nav>
                </div>
            </div>
        </p>
        <p id="leadtime-no-results">No cards found in tha last list of your Kanban Flow. Go back and define your flow again</p>
